import React from "react";
import { Header } from "./Componentes/Header";
import { ProductosLista } from "./Componentes/Productos";
import "boxicons";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { Paginas } from "./Componentes/paginas";

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <ProductosLista />
        <Paginas />
      </Router>
    </div>
  );
}

export default App;
